import React from 'react';

const App = () => {
  const people = [
    { name: "John", age: 30, position: 'Dev Ops', id: 1, cat: 'male' },
    { name: "Stella", age: 49, position: 'Waiter', id: 2, cat: 'female'  },
    { name: "Bob", age: 39, position: 'Graphics', cat: 'male', id: 3 },
    { name: "Bob", age: 39, position: 'Graphics', id: 3, cat: 'male' },
  ];

  // Create a Set to filter out duplicate names and convert to lowercase
  const uniqueNames = [...new Set(people.map(item => item.cat.toLowerCase()))];

  return (
    <div>
      {uniqueNames.map((name, index) => (
        <p key={index}>{name}</p>
      ))}
    </div>
  );
}

export default App;
